(()=>{"use strict";jQuery(document).ready(function(e){var t=e(".price-list");t.on("click",function(a){t.find(".acc-item").each(function(c,t){e(t).is(e(a.target).closest(".acc-item"))||((t=e(t)).find(".acc-content").hide(),t.find(".acc-btn").removeClass("active"))});var c=e(a.target).closest(".acc-item");c.find(".acc-btn").hasClass("active")?(c.find(".acc-content").hide(),c.find(".acc-btn").removeClass("active")):(c.find(".acc-content").show(),c.find(".acc-btn").addClass("active"))})})})();